import "../styles/Footer.css";


function Footer() {
    return (
      <footer className="footer">
        <a href="https://github.com/rdevans87"><img src="https://img.icons8.com/nolan/2x/github.png" height="100px" alt="github"className="icon"/></a>
        <a href="https://www.linkedin.com/in/ryanevanscreative/"><img src="https://img.icons8.com/nolan/2x/linkedin.png" height="100px" alt="Linkedin" className="icon"/></a>
        <a href="mailto:rdevans87@gmail.com"><img src="https://img.icons8.com/nolan/2x/email.png" height="90px" alt="email" className="icon"/></a>
        <a href="tell:3306711076"><img src="https://img.icons8.com/nolan/2x/apple-phone.png" height="105px" alt="phone" className="icon"/></a>
    </footer>

);
  }

  export default Footer;
